def get_combinations_for_all_nums_for_m_in_l(m, l):
    # print("m: {}, l: {}".format(m, l))
    assert m <= l

    t = (l-m+1, )+(1, )*(m-1)
    # print("t: {}".format(t))

    nums_amount_dict = {t: tuple(np.unique(t, return_counts=True)[1])}

    def get_all_addition_tupels(t):
        t = list(t)
        # print("t: {}".format(t))
        i = 1
        while t[0] > t[1]+1 and i < m:
            t[0] -= 1
            t[i] += 1
            i += 1
            t_new = tuple(t)
            # print("t_new: {}".format(t_new))
            if not t_new in nums_amount_dict:
                nums_amount_dict[t_new] = tuple(np.unique(t, return_counts=True)[1])
                get_all_addition_tupels(t_new)
    get_all_addition_tupels(t)

    # print("nums_amount_dict:\n{}".format(nums_amount_dict))

    fac_m = fac(m)
    fac_l = fac(l)
    nums_combination_dict = {}
    nums_lst = []
    sum_nums = 0
    for key, val in nums_amount_dict.items():
        p1 = 1
        for i in key:
            p1 *= fac(i)
        p2 = 1
        for i in val:
            p2 *= fac(i)

        # print("key: {},  val: {}".format(key,  val))
        # print(" p1: {}, p2: {}".format(p1, p2))

        p = fac_l*fac_m//(p1*p2)
        # print("key: {}, val: {}, p: {}".format(key, val, p))
        nums_combination_dict[key] = p
        nums_lst.append(p)
        sum_nums += p
    # print("nums_lst: {}".format(nums_lst))
    # print("sum_nums: {}".format(sum_nums))

    # input("Press ENTER to continue...")

    return sum_nums, len(nums_amount_dict), nums_amount_dict


def get_empiric_plot(m, lst):
    arr = np.array(lst)

    length = len(lst)
    l_plus = 31
    pos_neg_tbl = np.zeros((l_plus, 3), dtype=np.int)
    for k in range(m, m+l_plus):
        pos_neg_row = pos_neg_tbl[k-m]
        arr_tbl = np.zeros((length-k+1, k), dtype=np.int)
        for j in range(0, k-1):
            arr_tbl[:, j] = arr[j:-k+j+1]
        j += 1
        arr_tbl[:, j] = arr[j:]
        # print("k: {}, arr_tbl:\n{}".format(k, arr_tbl))
        # print("arr_tbl.shape: {}".format(arr_tbl.shape))
        pos_neg_row[0] = arr_tbl.shape[0]
        # row_pos = 0
        # row_neg = 0
        for row in arr_tbl:
            if m == np.unique(row).shape[0]:
                # row_pos += 1
                pos_neg_row[1] += 1
            else:
                # row_neg += 1
                pos_neg_row[2] += 1
        print("m: {}, pos_neg_row: {}".format(m, pos_neg_row))
        # print("m: {}, row_pos: {}, row_neg: {}".format(m, row_pos, row_neg))
    print("pos_neg_tbl:\n{}".format(pos_neg_tbl))

    percentage_per_l = pos_neg_tbl[:, 1] / pos_neg_tbl[:, 0]
    percentage_per_l_dif = percentage_per_l[1:]-percentage_per_l[:-1]

    plt.figure()

    plt.title("Empiric percentage for l in m: {m}".format(m=m))

    plt.xlabel("l")
    plt.ylabel("percentage of m in l")

    plt.plot(np.arange(m, m+percentage_per_l.shape[0]), percentage_per_l, "b.-")


    plt.figure()

    plt.title("Empiric percentage for l in m: {m}, differentation".format(m=m))

    plt.xlabel("l")
    plt.ylabel("percentage of m in l")

    plt.plot(np.arange(m, m+percentage_per_l_dif.shape[0]), percentage_per_l_dif, "g.-")

    plt.show()


